import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import AppNavbar from './components/AppNavbar';
import ShoppingList from './components/ShoppingList';



function App() {
  return (
    <div className="App">
      <AppNavbar />
      <ShoppingList />
      <h1>Hello</h1>
    </div>
  );
}

export default App;
